import './App.css';

function App() {
  return (
    <div className="App">
      <fieldset>
        <input name="name" type="text"></input>
        <input name="email" type="email"></input>
        <input name="cpf" type="number"></input>
        <input name="address" type="text"></input>
        <input name="city" type="text"></input>
        <input name="state" type="checkbox"></input>
        <input name="residence" type="radio"></input>


      </fieldset>


    </div>
  );
}

export default App;
